PRAGMA foreign_keys = ON;

create table user (
	user_id INTEGER PRIMARY KEY AUTOINCREMENT,
	role_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50) UNIQUE,
	password TEXT,
	address VARCHAR(50),
	phone INT,
	is_active boolean,
	created_at DATE,
	FOREIGN KEY (role_id) REFERENCES userprofile(role_id)
);
